import Head from 'next/head'

class CustomHead extends React.Component{
    render(){
        return (
            <Head>
            
            <title>Luca Provenzano | .NET Developer</title>

            <meta charset="utf-8"/>
            <meta http-equiv="X-UA-Compatible" content="IE=edge"/>
            <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
            <meta name="description" content="Luca Provenzano Resume"/>
            <meta name="author" content="Luca Provenzano"/>    

            </Head>
        )
    }
}

export default CustomHead;s
